import { ClassNames } from "@emotion/react";
import HeaderComponent from "../../components/header/Header";
import React from "react";
import { FoodContainer } from "../../components/foodcontainer/foodContainer";
import Hamburger from '../../components/imgs/Categories/hamburger.webp';
import Healthy from '../../components/imgs/Categories/healthy.webp';
import Pasta from '../../components/imgs/Categories/pasta.webp';
import Pizza from '../../components/imgs/Categories/pizza.webp';
import SeaFood from '../../components/imgs/Categories/seafood.webp';
import Steak from '../../components/imgs/Categories/steak.webp';

function Categories(){
    return (
        <div className="app">
        <HeaderComponent />
        <h1>Categories</h1>

        <div className="foods">
        <div className="grid">
        <FoodContainer
        image={Hamburger} 
        children="Outback">
        </FoodContainer>

        <FoodContainer
        image={Healthy} 
        children="Healthy">
        </FoodContainer>

        <FoodContainer
        image={Pasta} 
        children="Pasta">
        </FoodContainer>

        <FoodContainer
        image={Pizza} 
        children="Pizza">
        </FoodContainer>

        <FoodContainer
        image={SeaFood} 
        children="Sea Food">
        </FoodContainer>

        <FoodContainer
        image={Steak} 
        children="Steak">
        </FoodContainer>

        </div>
        </div>

        </div>
    )
}

export default Categories;
